import React, { useState } from 'react';
import './App.css';
import pokedex from './images/pokedex.png';
import pikachu from './images/pikachu.png';
import {Link} from 'react-router-dom';
import toggleIn from './images/toggle-in.png'

const Header = () => {
    const [set, setState] = useState(false);
    const[toogle, setToggle] =  useState({
        toggleIn:{
            background: '#ffffff',
            color: 'rgb(107, 102, 102)'
        },
        toggleOut:{
            background: 'rgb(107, 102, 102)',
            color: '#ffffff'
        }
    })
    return(
        <div>
            <header>
            <img src={pokedex} className='pokedex' alt="logo"/>
            <img src={pikachu} className="pikachu" alt='pik'/>
            </header>
            <nav>
                <button><img src={toggleIn}/></button>
                <Link to="about">About</Link>
                <Link to="pokemonlist">Pokemon List</Link>
                <Link to='/'>Home</Link>
            </nav>
        </div>
    )
}

export default Header;
